scriptlet.script:
try{
	var date2=new Date(parsedNewMaturityDate);//Remember, months are 0 based in JS
	var date1=new Date(parsedMssLoanStartDate);
	var year1=date1.getFullYear();
	var year2=date2.getFullYear();
	var month1=date1.getMonth();
	var month2=date2.getMonth();
	if(month1===0){ //Have to take into account
  	month1++;
  	month2++;
	}
	var currVal;
	currVal = (year2 - year1) * 12 + (month2 - month1);
	scriptletContext.put("currVal",currVal);
	response = "success";
} catch(err) {
				scriptletContext.put("errorMessage",err.message);	
				response = "failure";
			}
			scriptletResponse = response

String.prototype.lpad = function(padString, length) {
    var str = this;
    while (str.length < length)
        str = padString + str;
    return str;
}
str = currVal;
a = str.lpad("0", 3);

scriptletContext.put("currVal",a);

